import styled from "styled-components";

const ContainerDiv = styled.div`
  width: 100%;
  position: relative;
`;
const Sec02Top = styled.div`
  & > h2 {
    font-size: 45px;
    font-weight: 45px;
    font-family: 'KOTRA HOPE';
    font-weight: normal;
    font-style: normal;
    background: linear-gradient(#39DC72 60%, #27E4A8 100%);
    background-clip: text;
    -webkit-background-clip: text;
    color: transparent;
    margin-bottom: 20px;
  }
  & > p {
    font-size: 18px;
    font-weight: 20px;
    color: #3DAD72;
    margin-bottom: 50px;
  }
`;


function Section02() {

  return (
    <ContainerDiv>
      <div className="row">
        <Sec02Top className="col-md-12 text-center">
          <h2>추천글랭핑</h2>
          <p>여행 일정을 선택하고 특가를 확인하세요!
            여행 일정을 특가를 확인하세요!</p>
        </Sec02Top>
      </div>
    </ContainerDiv>
  );
};
export default Section02;
